        "SELECT *,",
        "              case when TMOVCOMPL.TIPODESC = 0 then PERCENTUALDESC else TMOVCOMPL" +
            ".VALORDESCRAT end as \'VALORPERCENTUALDESC\'",
        "",
        "FROM TMOV, TMOVCOMPL, TMOVHISTORICO",
        "",
        "WHERE TMOV.CODCOLIGADA = TMOVCOMPL.CODCOLIGADA",
        "  AND TMOV.IDMOV = TMOVCOMPL.IDMOV",
        "  AND TMOV.CODCOLIGADA = TMOVHISTORICO.CODCOLIGADA",
        "  AND TMOV.IDMOV = TMOVHISTORICO.IDMOV",
        "",
